import React from 'react';

const About = () => {
    return (
        <div className="about">
            <h1>About Me</h1>
            <p>
                Hello! I'm a passionate web developer with a love for creating dynamic and responsive web applications. 
                I have experience in various technologies including React, JavaScript, HTML, and CSS.
            </p>
            <h2>Skills</h2>
            <ul>
                <li>JavaScript</li>
                <li>React</li>
                <li>HTML & CSS</li>
                <li>Node.js</li>
                <li>Git & GitHub</li>
            </ul>
            <h2>Biography</h2>
            <p>
                I graduated with a degree in Computer Science and have been working in the tech industry for over 3 years. 
                I enjoy solving complex problems and continuously learning new technologies to enhance my skills.
            </p>
        </div>
    );
};

export default About;
